import React from "react";
import titlehoinghi from "../assets/titlehoinghi.png";
function App() {
  const navigateToPage = (page) => {
    window.location.href = page; // Navigate to the specified page
  };

  return (
    <div className="chaomung-wrapper" style={{
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'center',
      alignItems: 'center',
      height: '100vh'
    }}>
      <img
        src={titlehoinghi} // Replace with your image URL
        alt="titlehoinghi"
        className="main-image"
        style={{ maxWidth: '100%', height: 'auto', marginBottom: '20px' }}
      />
      <h1 className="main-title"></h1>
      <div className="button-container" style={{ display: 'flex', gap: '10px' }}>
        <button onClick={() => navigateToPage("/diemdanh")}>Điểm danh</button>
        <button onClick={() => navigateToPage("/dangky")}>Đăng Ký</button>
      </div>

      <style jsx>{`
        button {
          padding: 10px 20px;
          border: none;
          border-radius: 5px;
          background-color: #1fb7b7;
          color: white;
          cursor: pointer;
        }

        button:hover {
          background-color: #0056b3;
        }
      `}</style>
    </div>
  );
}

export default App;
